#pragma once
#include<iostream>
using namespace std;
class A
{
	double i;
public:
	A(double a = 0)
	{
		i = a;
		cout << "(A) ";
	}
	A(const A& x)
	{
		i = x.i;
		cout << "(A&) ";
	}
	~A()
	{
		cout << "~A() ";
	}
	operator double() const
	{
		cout << "(double) ";
		return i;
	}
};


#include"Header.h"
int main()
{
	A a, b = a; //constructor implicit; constructor de copiere
	a = 1;//constructor implicit + stergere
	double d = b;//conversie b in double
	cout << a << " " << d << " ";//nu este supraincarcat<<; converteste a in double; afisare
	cout << a + b<<" ";//nu este supraincarcat +, converteste a si b la double si face suma ca double, afisare, stergere b si a
	return 0;
 }
